import io
import gc
from ulab import numpy as np            # type: ignore
import microlite                        # type: ignore

# Flag to choose the model type
use_lstm = True

if use_lstm:
	model_size = 13952 + 1024
	model_name = "mnist_lstm_quant.tflite"
else:
	model_size = 16200 + 1024
	model_name = "mnist_cnn_quant.tflite"

# Load the model into memory
model_data = bytearray(model_size)
with io.open(model_name, 'rb') as model_file:
    model_file.readinto(model_data)

# Callback function to set the input tensor
def set_input_tensor(microlite_interpreter):
    global test_image
    input_tensor = microlite_interpreter.getInputTensor(0)
    for i in range(len(test_image)):
        input_tensor.setValue(i, test_image[i])

# Callback function to get the output tensor and find the predicted number
def get_output_tensor(microlite_interpreter):
    output_tensor = microlite_interpreter.getOutputTensor(0)
    global predicted_number
    global predict_value
    predicted_number = -1
    max_value = -128
    for i in range(10):
        value = output_tensor.getValue(i)
        value_quantize = output_tensor.quantizeInt8ToFloat(value)
        if (value >= max_value):
            max_value = value
            predicted_number = i
            predict_value = value_quantize
        if print_output:
            print(f"  {i}: {value_quantize:.5f}")

